// const express = require('express');  // tạo server API
// const morgan = require('morgan');    // Ghi log các request đến server
// const cors = require('cors');        // Cho phép API được gọi từ các domain khác
import initRoutes from './src/routers'
import cors from 'cors'
import express from 'express'
import morgan from 'morgan'
require('./connection_db')
require('dotenv').config();          // Đọc file .env để sử dụng biến môi trường (process.env.VARIABLE).


const app = express()// Tạo một instance của Express để dùng cho server.
app.use(cors({
    origin: process.env.CLIENT_URL,
    methods: ['GET', 'POST', 'PUT', 'DELETE']
}))
// const initRoutes = require('./src/routers')//inport index.js trong folder routers (chứa danh sách API endpoint)
app.use(morgan('combined'))//giúp log thông tin về mỗi request theo chuẩn Apache Combined Log Format


app.use(express.json())//Cho phép server hiểu dữ liệu JSON từ request body.
app.use(express.urlencoded({ extended: true }))// Hỗ trợ dữ liệu form-encoded (trong json)

initRoutes(app)//đăng ký các route API vào app
const port = process.env.PORT || 8888

//127.0.1 - localhost
app.listen(port, () => console.log(`listening at http://localhost:${port}`));

