import { where } from 'sequelize';
import db from '../models'

export const getOne = (userId) => new Promise(async (resolve, reject) => {
    try {
        const response = await db.User.findOne({
            where: { id: userId },
            attributes: {
                exclude: ['password', 'role_code', 'refresh_token']
            },
            include: [{ model: db.Role, as: 'roleData', attributes: ['id', 'code', 'value'] }]
        })//tra ve 1 instance cua sequelize

        resolve({
            err: response ? 0 : 1,
            mes: response ? 'User found' : 'user not found',
            userData: response || null
        })

    } catch (error) {
        reject(error)
    }
})

