        const isChecked = err instanceof TokenExpiredError
        if (err) {
            if (!isChecked) return notAuth('Access token invalid', res, isChecked)
            if (isChecked) return notAuth('Access token expired', res, isChecked)
        }
        req.user = user
        next()
    })
}
export default verifyToken

