import db from '../models'
import { Op } from 'sequelize'
import { v4 as generateId } from 'uuid';
const cloudinary = require('cloudinary').v2;

// Trang (page): Xác định phần dữ liệu nào sẽ được lấy.
// Giới hạn (limit): Số lượng sách tối đa trên mỗi trang.
// Sắp xếp (order): Xác định thứ tự sắp xếp.
// Tên sách (name): Tìm kiếm sách theo tên.
// Các tiêu chí tìm kiếm khác (...query): Các điều kiện lọc bổ sung =>...query dùng để lấy các tham số khác mà không nằm trong danh sách cố định (page, limit, order, name)

export const getBooks = ({ page, limit, order, name, ...query }) => new Promise(async (resolve, reject) => {
    //Trả về một Promise, trong đó sử dụng async/await để xử lý bất đồng bộ
    try {
        const queries = { raw: true, nest: true }//Chứa các tùy chọn truy vấn (ví dụ: phân trang (page), sắp xếp (order), số lượng bản ghi(limit))
        //#query: Chứa các điều kiện lọc dữ liệu (các đk sau WHERE... trong SQL).
        //raw: true: Kết quả trả về là object thuần (không có instance của Sequelize).
        // nest: true: Tổ chức dữ liệu lồng nhau khi có quan hệ giữa các bảng.

        const offset = (!page || +page <= 1) ? 0 : (+page - 1)// Xác định vị trí bắt đầu của dữ liệu cần lấy.
        // Nếu page <= 1 hoặc không có page, offset = 0 (bắt đầu từ đầu).
        // Ngược lại, offset sẽ bằng (page - 1), để tính toán phần dữ liệu cần lấy dựa trên phân trang.

        const finalLimit = +limit || +process.env.LIMIT_BOOK // Giới hạn số sách trên mỗi trang
        //+limit:chỉ dạng số

        queries.offset = offset * finalLimit//số offset sd cho truy vấn
        queries.limit = finalLimit//giới hạn sl sách truy vấn

        if (order) queries.order = [order]//nếu có order => thêm vào truy vấn
        if (name) query.title = { [Op.substring]: name }//nếu có tên => thêm đk lọc tên (tìm kiếm tên sách chứa chuỗi name)

        // if(available) query.available={[Op.between]:available}
        const response = await db.Book.findAndCountAll({
            where: query,
            ...queries,
            attributes: { exclude: ['category_code'] },
            include: [{
                model: db.Category,
                as: 'categoryData',
                attributes: { exclude: ['createdAt', 'updatedAt'] }
            }],
        })

        resolve({
            err: response ? 0 : 1,
            mes: response ? 'Got' : 'Can not found books ',
            bookData: response
        })
        console.log('after resolve');
    } catch (error) {
        reject(error)
    }
})


//CREATE
export const createNewBook = (body, fileData) => new Promise(async (resolve, reject) => {
    //Trả về một Promise, trong đó sử dụng async/await để xử lý bất đồng bộ
    try {

        const response = await db.Book.findOrCreate({
            where: { title: body?.title },
            defaults: {
                ...body,
                id: generateId(),
                image: fileData?.path,
                filename: fileData?.filename
            }//generateId thêm id vào khi ko dùng autoIncrement
        })
        if (fileData && !response[1]) {
            await cloudinary.uploader.destroy(fileData.filename);
        }
        resolve({
            err: response[1] ? 0 : 1,
            mes: response[1] ? 'Created' : 'Cannot create new book because this book has been existed',
        })

    } catch (error) {
        if (fileData) {
            await cloudinary.uploader.destroy(fileData.filename);
        }
        reject(error)

    }
})

//UPDATE
export const updateBook = ({ bookId, ...body }, fileData) => new Promise(async (resolve, reject) => {

    try {
        if (fileData) body.image = fileData?.path //nếu sửa ảnh
        const response = await db.Book.update(body, {
            where: { id: +bookId }
        })

        resolve({
            err: response[0] > 0 ? 0 : 1,
            mes: response[0] > 0 ? `${response[0]} book(s) updated` : 'Book id not found',
        })
        if (fileData) {
            await cloudinary.uploader.destroy(fileData.filename);
        }

    } catch (error) {

        reject(error)
        if (fileData) {
            await cloudinary.uploader.destroy(fileData.filename);
        }
    }
})
/*
params={
    bookIds=[id1,id2]
    filename=[filename1,filename2]
}
*/

//DELETE
export const deleteBook = (bookIds, fileName) => new Promise(async (resolve, reject) => {
    try {
        const response = await db.Book.destroy({
            where: { id: bookIds }
        })
        await cloudinary.api.delete_resources(fileName);
        resolve({
            err: response > 0 ? 0 : 1,
            mes: `${response} book(s) deleted`,
        })

    } catch (error) {

        reject(error)
    }
})

