import * as services from '../service'
import { internalServerError, badRequest } from '../middleWares/handle_error'
import { title, image, category_code, price, bookId, bookIds, filename } from '../helpers/joi_schema'
import Joi from 'joi'
const cloudinary = require('cloudinary').v2;

export const getBooks = async (req, res) => {
    try {
        const response = await services.getBooks(req.query)
        //req.query:Lấy dữ liệu từ URL (?key=value)+ dùng cho  truy vấn dữ liệu, lọc dữ liệu, phân trang, sắp xếp + thường sd với GET
        return res.status(200).json(response)
    } catch (error) {
        return internalServerError(res)
    }
}
export const createNewBook = async (req, res) => {
    try {
        // if (!req.body?.title || !req.body?.price || !req.body?.category_code || !req.body?.image) {
        //     return res.status(400).json({
        //         err: 1,
        //         mes: 'missing input'
        //     })
        // }
        const fileData = req.file
        console.log(fileData);

        const { error } = Joi.object({ title, image, category_code, price }).validate({ ...req.body, image: fileData?.path })
        //nếu dùng req.body dưới dạng object con thay...req.body =>sai.

        // nhưng Joi.validate() yêu cầu từng field (title, image, category_code, price) phải nằm trực tiếp trong object.

        if (error) {
            if (fileData) {
                await cloudinary.uploader.destroy(fileData.filename);
            }
            return badRequest(error.details[0].message, res)
        }

        const response = await services.createNewBook(req.body, fileData)

        return res.status(200).json(response)
    } catch (error) {
        return internalServerError(res)
    }
}
export const updateBook = async (req, res) => {
    try {
        const fileData = req.file
        console.log(req.body);
        const { error } = Joi.object({ bookId }).validate({ bookId: req.body.bookId })

        if (error) {
            if (fileData) {
                await cloudinary.uploader.destroy(fileData.filename);
            }
            return badRequest(error.details[0].message, res)
        }

        const response = await services.updateBook({ bookId, ...req.body }, fileData);

        return res.status(200).json(response)
    } catch (error) {
        return internalServerError(res)
    }
}

export const deleteBook = async (req, res) => {
    try {
        // const { error } = Joi.object({ bookIds, name }).validate(req.query)
        //->thêm tên vào nếu muốn kt tên
        const { error } = Joi.object({ bookIds, filename }).validate(req.query)
        if (error) {
            return badRequest(error.details[0].message, res)
        }

        const response = await services.deleteBook(req.query.bookIds, req.query.filename);

        return res.status(200).json(response)
    } catch (error) {
        console.log(error);

        return internalServerError(res)
    }
}

